import React from "react";
import Link from "next/link";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
`;

export const Header: React.FC = () => (
  <Wrapper>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/posts/new">
      <a>Create new post</a>
    </Link>
  </Wrapper>
);
